import React, { useState } from 'react';
import { FaTimes } from 'react-icons/fa';
import './TransactionModal.css';
import apiService from '../services/api';

const TransactionModal = ({ onClose, onTransactionAdded }) => {
  const [formData, setFormData] = useState({
    asset_type: 'crypto',
    ticker: '',
    price: '',
    quantity: ''
  });
  
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    // Validate form
    if (!formData.ticker || !formData.price || !formData.quantity) {
      setError('Please fill in all fields');
      return;
    }
    
    try {
      setLoading(true);
      setError(null);
      
      // Convert price and quantity to numbers
      const transactionData = {
        ...formData,
        ticker: formData.ticker.toUpperCase(),
        price: parseFloat(formData.price),
        quantity: parseFloat(formData.quantity)
      };
      
      // Add transaction via API
      await apiService.addTransaction(transactionData);
      
      // Notify parent component
      onTransactionAdded();
      
      // Close modal
      onClose();
    } catch (err) {
      console.error('Error adding transaction:', err);
      setError('Failed to add transaction. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="modal-backdrop" onClick={onClose}>
      <div className="modal-content" onClick={e => e.stopPropagation()}>
        <div className="modal-header">
          <div className="modal-title">Add Transaction</div>
          <div className="modal-close" onClick={onClose}>
            <FaTimes />
          </div>
        </div>
        
        {error && <div className="error-message">{error}</div>}
        
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label className="form-label">Asset Type</label>
            <select 
              name="asset_type" 
              className="form-select"
              value={formData.asset_type}
              onChange={handleChange}
            >
              <option value="crypto">Cryptocurrency</option>
              <option value="stock">Stock</option>
            </select>
          </div>
          
          <div className="form-group">
            <label className="form-label">Ticker Symbol</label>
            <input 
              type="text" 
              name="ticker" 
              className="form-control"
              placeholder="e.g. BTC, AAPL"
              value={formData.ticker}
              onChange={handleChange}
            />
          </div>
          
          <div className="form-group">
            <label className="form-label">Purchase Price (USD)</label>
            <input 
              type="number" 
              name="price" 
              className="form-control"
              placeholder="e.g. 50000"
              value={formData.price}
              onChange={handleChange}
              min="0"
              step="0.01"
            />
          </div>
          
          <div className="form-group">
            <label className="form-label">Quantity</label>
            <input 
              type="number" 
              name="quantity" 
              className="form-control"
              placeholder="e.g. 0.5"
              value={formData.quantity}
              onChange={handleChange}
              min="0"
              step="0.000001"
            />
          </div>
          
          <button 
            type="submit" 
            className="btn btn-primary btn-block"
            disabled={loading}
          >
            {loading ? 'Adding...' : 'Add Transaction'}
          </button>
        </form>
      </div>
    </div>
  );
};

export default TransactionModal;
